import axios from 'axios';
import { useQuery } from 'react-query';

export const useVegetableProducts = (pageNumber) =>
  useQuery([pageNumber, 'Vegetables'], getVegetableProducts, {
    retry: 0,
    staleTime: 60 * 1000 * 5,
    cacheTime: 0,
  });

const getVegetableProducts = async (context) => {
  const [pageNumber, ] = context.queryKey;
  const res = await axios.get(
    `/api/products?pageNumber=${pageNumber}&category=Vegetables&pageSize=20`
  );
  return res.data;
};
